  return (
    <form className="btn-check">
      <input className="btn-check__input" type="checkbox" value="big" />
      <label className="btn-check__label">big house</label>
      <br />
      <input className="btn-check__input" type="checkbox" value="middle" />
      <label>middle house</label>
      <br />
      <input className="btn-check__input" type="checkbox" value="small" />
      <label>small house</label>
    </form>
  );
};

